<area shape="rect" id="id2" href="Goal.html" title="Goal is an aim defined under a persona and its sub-types - engineer and organization. " alt="" coords="1855,1476,1913,1532"/>
<area shape="rect" id="id3" href="Topic.html" title="Topic is a group of related messages in a forum. " alt="" coords="1029,1476,1091,1532"/>
<area shape="rect" id="id4" href="Event.html" title="Event is a named temporal. " alt="" coords="641,1300,703,1356"/>
<area shape="rect" id="id5" href="Forum.html" title="Discussion forum which can contain sub-forums and discussion topics. " alt="" coords="738,1300,806,1356"/>
<area shape="rect" id="id6" href="Module.html" title="Module is a part of product or another module. " alt="" coords="2000,1300,2072,1356"/>

<area shape="rect" id="id8" href="Feature.html" title="Feature is a unit of consumption of product functionality. " alt="" coords="244,1631,318,1687"/>

<area shape="rect" id="id10" href="Persona.html" title="Personas represent represent the different types of consumers of products and services. " alt="" coords="1875,969,1954,1025"/>
<area shape="rect" id="id11" href="Release.html" title="Release is a unit of delivering product features to its consumers. " alt="" coords="2612,1631,2691,1687"/>
<area shape="rect" id="id12" href="Principle.html" title="Principles are general rules and guidelines, intended to be enduring and seldom amended, that inform and support the way in which an engineer or an organization sets about achieving its goals or addressing goals of their consumers modeled as personas..." alt="" coords="1665,1476,1745,1532"/>
<area shape="rect" id="id13" href="Directory.html" title="Directory is a container of named elements, e.g. documents, links, or other directories. " alt="" coords="1150,969,1230,1025"/>
<area shape="rect" id="id14" href="Objective.html" title="Objective is something that should be achieved as part of endeavor such as an increment or a release. " alt="" coords="2778,1300,2860,1356"/>
<area shape="rect" id="id15" href="Alignable.html" title="Something that can be aligned to aims by alignments - aims or endeavors." alt="" coords="1664,63,1749,119"/>
<area shape="rect" id="id16" href="Allocation.html" title="Allocation of engineers capacity to spend on a particular engineered element and issue category on a particular endeavor. " alt="" coords="2110,1631,2195,1687"/>
<area shape="rect" id="id17" href="Increment.html" title="Increment is a period of time to plan releases and schedule issues for. " alt="" coords="2506,1300,2593,1356"/>
<area shape="rect" id="id18" href="Link.html" title="Link to an external URL. " alt="" coords="317,1293,394,1362"/>
<area shape="rect" id="id19" href="IssuePriority.html" title="Issue priority, e.g. Low, Medium, High. " alt="" coords="1222,1300,1322,1356"/>

<area shape="rect" id="id21" href="Message.html" title="A message in a discussion topic authored by an engineer on a specific date." alt="" coords="1066,1293,1149,1362"/>
<area shape="rect" id="id22" href="IssueSeverity.html" title="Issue severity, e.g. Feature, Minor, Major, Crash. " alt="" coords="1357,1300,1462,1356"/>
<area shape="rect" id="id23" href="Alignment.html" title="An association class between aims and engineered capabilities. " alt="" coords="106,1469,193,1538"/>
<area shape="rect" id="id24" href="NamedElement.html" title="Named element, as the name suggests, is a base class for model elements with a name." alt="" coords="776,1131,895,1187"/>
<area shape="rect" id="id25" href="IssueStatus.html" title="Issue status, e.g. Open, In Progress, Done. " alt="" coords="933,1293,1031,1362"/>
<area shape="rect" id="id26" href="Capability.html" title="Capability is something that can be required by an issue to start working on it. " alt="" coords="143,1293,245,1362"/>
<area shape="rect" id="id27" href="EngineeredElement.html" title="Engineered element is something that is brought about by engineers working on issues associated with the engineered element. " alt="" coords="1744,714,1886,770"/>
<area shape="rect" id="id28" href="Capacity.html" title="Capacity is contained under Engineer and defines how much total effort or funds the containing engineer has to spend on a particular endeavor. " alt="" coords="2352,1279,2434,1376"/>
<area shape="rect" id="id29" href="Engineer.html" title="Engineers are entities, people or organizations, owning engineered elements and working on endeavors, e.g. issues. " alt="" coords="1809,1117,1908,1200"/>
<area shape="rect" id="id30" href="EngineeredCapability.html" title="Engineered capability extends both endeavor and capability and is a base class for issue, feature, and release. " alt="" coords="1820,377,1970,433"/>
<area shape="rect" id="id31" href="KeyResult.html" title="Key Results are specific measures used to track achievement of their containing objective. " alt="" coords="2734,1462,2839,1545"/>
<area shape="rect" id="id32" href="IssueCategory.html" title="A mechanism for grouping/tagging issues. " alt="" coords="1443,1462,1555,1545"/>

<area shape="rect" id="id34" href="Endeavor.html" title="Endeavor is a base class for things which take time, effort, and money to achieve some benefit - increments, and engineered capabilities - issues, features, and releases. " alt="" coords="2390,218,2495,315"/>
<area shape="rect" id="id35" href="Decision.html" title="Decision is an issue, which is also an aim, i.e. endeavors, such as issues, and other aims such as other decisions may be aligned to it. " alt="" coords="1205,1455,1314,1552"/>
